import {useState, useEffect} from "react";
import useFetch from "./useFetch";

const Form = () => {
    const { error, isPending, data: kiosk } = useFetch('http://localhost:8000/kiosk')
    /*
    useEffect(() => {
        fetch('http://localhost:8000/kiosk')
        .then(res => {
            return res.json();
        })
        .then(data => {
            setKiosks(data);
            console.log(kiosks);
        })
    }, [])*/
    //const { error, isPending, data: kiosks } = useFetch('http://localhost:8000/kiosk');

    return ( 
        <div>
            { error && <div>{ error }</div> }
            { isPending && <div>Loading...</div> }
            {kiosk && kiosk.map(kiosk => (
                <div>
                <h2>Location of {kiosk.name}</h2>
                <h2>{kiosk.latitude}</h2>
                <h2>{kiosk.longitude}</h2>
                </div>
            ))}
        </div>
     );
}
 
export default Form;
